INSERT INTO `products` (`category`, `subcategory`, `name`, `price`, `number`, `shortage_cost`, `annual_cost_stock`, `delivery_time`) SELECT MAX(category) 'category', MAX(subcategory) 'subcategory', SUBSTRING_INDEX(name, '_', - 1) 'name', MAX(price) 'price', CEIL(SUM(number) / 12) 'number', MAX(shortage_cost) 'shortage_cost', MAX(annual_cost_stock) 'annual_cost_stock', MAX(delivery_time) 'delivery_time' FROM `products_log` GROUP BY name;
